                        errorMask.ReportException(ex);
                    }
                    finally
                    {
                        errorMask?.PopIndex();
                    }
                    return TryGet<int?>.Succeed((int)LogEntry_FieldIndex.ResultScript);
                default:
                    return TryGet<int?>.Failure;
            }
